import React, { Component } from 'react';

class Upcoming extends Component {
    render() {
        return (
          <section className="section has-text-light has-background-black">
          <div className="container is-fluid">
          <h2 className="subtitle column is-10 is-offset-1">a ride across the US to end mental health stigma</h2>
            <div className="columns is-multiline">
              <div className="column is-1"></div>
              <div className="column">
              <p>feel trip is a fully-unsupported, 3500-mile bike ride from New York, NY to Los Angeles, CA. Participants raise money for the National Alliance for Mental Illness (NAMI) and bring light to mental illness issues in an effort to reduce, and eventually eliminate, the surrounding stigma. </p>

              </div>
              <div className="column">
                <p>"But I must explain to you how all this mistaken idea of denouncing pleasure and praising pain was born and I will give you a complete account of the system, and expound the actual teachings of the great explorer of the truth, the master-builder of human happiness. No one rejects, dislikes, or avoids pleasure itself, because it is pleasure, but because those who do not know how to pursue pleasure rationally encounter consequences that are extremely painful. Nor again is there anyone who loves </p>
              </div>
              <div className="column is-1"></div>
          </div>
        </div>
          </section>
        )
    }
}
export default Upcoming;
